"밴드 " " 액정 보호필름" 만 바꾸면 완전히 새거로 변합니다 믿고 구매 해보세요 터치 이상없습니다  쿨 거래시 1~2만원 깍아드립니다  예약금 당근 페이로 보내주셔야 예약 가능합니다 요즘 산다고 하고 안나오시는분들이 많아서;;
